    const [movie,setmovie]=useState([])
    const [loading,setloading]=useState(false)

    useEffect(()=>{
        try{
          const url ='ttps://www.omdbapi.com/?i=tt3896198&apikey=8a7484af';
          async function fetchdata(){
            const res = await axios.get(url)
            setmovie(res.data)
            console.log(res.data)
          }
          fetchdata()
        } catch (error){
          console.log(error.message)
        }
        
      },[])
    return <div>
    <h1>The MovieList Page</h1>
    <ul >
        <li><Link  to='/movies/p1'> A Book</Link></li>
        <li><Link  to='/movies/p2'>A Carpet</Link></li>
        <li><Link  to='/movies/p3'>A online Course</Link></li>
    </ul>
    </div>
}

export default MovieList;
